import React from "react";
import { Link } from "react-router-dom";
import {
  Crown,
  Shield,
  Award,
  Users,
  Globe,
  CheckCircle,
  Star,
  Heart,
  TrendingUp,
} from "lucide-react";

const About = () => {
  return (
    <div className='about-page'>
      {" "}
      {/* Hero Banner */}{" "}
      <section className='about-hero'>
        <div className='container'>
          <div className='about-hero-content'>
            <h1>
              About HK <span> DEALERS </span>{" "}
            </h1>{" "}
            <p className='hero-subtitle'> Your Trust, Our Service </p>{" "}
            <p className='hero-description'>
              Premier luxury watch dealer in Hong Kong since 2010. Specializing
              in authentic Swiss timepieces with expert verification.{" "}
            </p>{" "}
          </div>{" "}
        </div>{" "}
      </section>
      {/* Mission Section */}{" "}
      <section className='mission-section'>
        <div className='container'>
          <div className='mission-grid'>
            <div className='mission-content'>
              <h2> Our Mission </h2>{" "}
              <p className='mission-text'>
                <strong> HKDEALERS </strong> was born from a simple belief:
                every collector deserves access to authentic luxury watches with
                complete transparency and expert service.{" "}
              </p>{" "}
              <p>
                We have combined{" "}
                <strong> decades of horological expertise </strong> with{" "}
                <strong> cutting - edge authentication technology </strong> to
                create Hong Kong 's most trusted platform for luxury watch
                acquisition.{" "}
              </p>{" "}
              <div className='mission-stats'>
                <div className='stat-item'>
                  <div className='stat-number'> 13 + </div>{" "}
                  <div className='stat-label'> Years in Business </div>{" "}
                </div>{" "}
                <div className='stat-item'>
                  <div className='stat-number'> 5, 000 + </div>{" "}
                  <div className='stat-label'> Watches Sold </div>{" "}
                </div>{" "}
                <div className='stat-item'>
                  <div className='stat-number'> 100 % </div>{" "}
                  <div className='stat-label'> Authenticity Rate </div>{" "}
                </div>{" "}
              </div>{" "}
            </div>{" "}
            <div className='mission-image'>
              <img
                src='https://images.unsplash.com/photo-1532703108230-1c5c75b2064d?ixlib=rb-4.0.3&auto=format&fit=crop&w=1200&q=80'
                alt='HKDEALERS Expert Authentication'
              />
              <div className='image-caption'>
                Expert watchmakers verifying luxury timepieces in our Hong Kong
                workshop{" "}
              </div>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </section>
      {/* Core Values */}{" "}
      <section className='values-section'>
        <div className='container'>
          <h2 className='section-title'> Our Core Values </h2>{" "}
          <div className='values-grid'>
            <div className='value-card'>
              <div className='value-icon'>
                <Shield />
              </div>{" "}
              <h3> Authenticity Guaranteed </h3>{" "}
              <p>
                Every watch undergoes rigorous 10 - point verification by
                certified Swiss watchmakers.{" "}
              </p>{" "}
            </div>{" "}
            <div className='value-card'>
              <div className='value-icon'>
                <Award />
              </div>{" "}
              <h3> Expert Curation </h3>{" "}
              <p>
                Our team of horologists hand - selects each timepiece for
                quality and heritage.{" "}
              </p>{" "}
            </div>{" "}
            <div className='value-card'>
              <div className='value-icon'>
                <Users />
              </div>{" "}
              <h3> Client Partnership </h3>{" "}
              <p>
                Building lifelong relationships through personalized service and
                transparent dealings.{" "}
              </p>{" "}
            </div>{" "}
            <div className='value-card'>
              <div className='value-icon'>
                <Globe />
              </div>{" "}
              <h3> Global Excellence </h3>{" "}
              <p>
                Serving collectors worldwide with secure international shipping
                and local support.{" "}
              </p>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </section>
      {/* Featured Section */}{" "}
      <section className='featured-section'>
        <div className='container'>
          <div className='featured-grid'>
            <div className='featured-image'>
              <img
                src='https://images.unsplash.com/photo-1551816230-ef5deaed4a26?ixlib=rb-4.0.3&auto=format&fit=crop&w=1200&q=80'
                alt='HKDEALERS Magazine Feature'
              />
              <div className='magazine-badge'>
                <TrendingUp size={24} /> <span>Featured in</span>
              </div>{" "}
            </div>{" "}
            <div className='featured-content'>
              <h2>
                HK <span> DEALERS </span> Featured in Luxury Magazine{" "}
              </h2>{" "}
              <p className='featured-subtitle'>
                Discover the story behind Hong Kong 's premier watch dealer, our
                mission, vision, and the impact we have created in the luxury
                watch market.{" "}
              </p>{" "}
              <div className='magazine-cover'>
                <div className='cover-placeholder'>
                  <Crown size={48} />{" "}
                  <div className='cover-text'>
                    <span> LUXURY </span> <span> WATCH </span>{" "}
                    <span> JOURNAL </span>{" "}
                  </div>{" "}
                </div>{" "}
              </div>{" "}
              <button className='btn btn-secondary'>
                {" "}
                Read Our Magazine Feature{" "}
              </button>{" "}
              <p className='featured-note'>
                A detailed article highlighting how HKDEALERS is reshaping
                luxury watch trading in Asia with transparency and
                expertise.{" "}
              </p>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </section>
      {/* Partnerships */}{" "}
      <section className='partnerships-section'>
        <div className='container'>
          <h2 className='section-title'> Trusted Partnerships </h2>{" "}
          <p className='section-subtitle'>
            We are proud to be partnered with leading organizations in the watch
            industry.{" "}
          </p>
          <div className='partnerships-grid'>
            <div className='partnership-card'>
              <div className='partnership-logo'>
                <Star size={40} />{" "}
              </div>{" "}
              <h3> Swiss Watch Federation </h3>{" "}
              <p> Official partner for certified pre - owned Swiss watches. </p>{" "}
              <Link
                to='#'
                className='partnership-link'>
                Learn More→{" "}
              </Link>{" "}
            </div>
            <div className='partnership-card'>
              <div className='partnership-logo'>
                <Heart size={40} />{" "}
              </div>{" "}
              <h3> Hong Kong Watch Guild </h3>{" "}
              <p> Collaborating to advance horological standards in Asia. </p>{" "}
              <Link
                to='#'
                className='partnership-link'>
                Visit Hong Kong Watch Guild→{" "}
              </Link>{" "}
            </div>
            <div className='partnership-card'>
              <div className='partnership-logo'>
                <Award size={40} />{" "}
              </div>{" "}
              <h3> International Watch Authenticators </h3>{" "}
              <p>
                {" "}
                Working together to advance watch authentication
                technology.{" "}
              </p>{" "}
              <Link
                to='#'
                className='partnership-link'>
                Explore Partnership→{" "}
              </Link>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </section>
      {/* Join Section */}{" "}
      <section className='join-section'>
        <div className='container'>
          <div className='join-content'>
            <h2> Join Our Community of Collectors </h2>{" "}
            <p className='join-subtitle'>
              Be part of Hong Kong 's most trusted network of luxury watch
              enthusiasts and collectors.Experience unmatched service and access
              to rare timepieces.{" "}
            </p>{" "}
            <div className='join-benefits'>
              <div className='benefit'>
                <CheckCircle size={20} />{" "}
                <span> Exclusive Access to Rare Pieces </span>{" "}
              </div>{" "}
              <div className='benefit'>
                <CheckCircle size={20} />{" "}
                <span> Private Viewing Events </span>{" "}
              </div>{" "}
              <div className='benefit'>
                <CheckCircle size={20} />{" "}
                <span> Trade - In & Upgrade Programs </span>{" "}
              </div>{" "}
              <div className='benefit'>
                <CheckCircle size={20} />{" "}
                <span> VIP Authentication Services </span>{" "}
              </div>{" "}
            </div>{" "}
            <div className='join-buttons'>
              <Link
                to='/contact'
                className='btn btn-primary'>
                Become a Client{" "}
              </Link>{" "}
              <Link
                to='/products'
                className='btn btn-secondary'>
                Browse Collection{" "}
              </Link>{" "}
            </div>{" "}
          </div>{" "}
        </div>{" "}
      </section>{" "}
    </div>
  );
};

export default About;
